INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '卢玉梅', '28', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/1023789x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn2/', '2016-11-08', '计划员，经理助理，生管员', '江西', '高中/中专', '', '', '', '', '', '3000-4999元', '沟通能力强,诚信正直,责任心强,阳光开朗,有创业经历', '龙达塑胶科技有限公司 工作时间： 2011年12月-2013年2月 在职职位： PMC计划员，跟单,采购 所属行业： 主要加工手机壳及各种喷漆物件及丝印。 工作职责： （1.根据客户提供样板进行打样,评估,打好样交给客户确认样板后并回签样板本司保留.2.根据打样数据进行分析评估此样单价,评估好单价给客户报价(对油漆,UV,开油水,制造费用,及其辅料的成本进行核算),并跟客户谈好付款方式及月结,损耗率.3.根据客户下的采购订单,制定生产工艺并安排生产,处理(1.物料是否齐全,2.来料素材是否与样板一致,3.所有辅助消耗品是否到齐,4.生产工艺流程,5.成品颜色是否OK.6.有无漏定物料.7.成品是否能按预定交期交货).4.月底做好对账单(外账)交给财务审核.5.根据部门填的申购单进行采购,和供应商谈好价格及月结方式签定《供应商合作协议书》，月底进行评审。6.本职位任职:PMC,跟单,采购,附加财务(外账).） 时间：2013年2月2014年11月 公司名称：深圳来昌鑫科技有限公司 公司性质： 公司经营：五金厂（公司主要生产手机背板和其它产品由五金厂及注塑部组成，公司设有独立的模具房及线割部） 担任职位：PMC计划员、物控、统计 工作描述： \"1.物控：申购原材料-首先确认库存料及产品-管控其数据真实准确性-对物料进行管控 -保证物料充足且不浪费来满足客房交期。（公司主要采购原材料物料如下：不锈钢、镀锌板、铝料、黄铜、猛钢等） 2.生产计划:根据订单审查表制作生产指令单安排生产-通知生产线区分客户要求的紧急重要及次要优先安排生产-处理生产中出现的任何异常事项-根据交货及订单情况安排加班。（公司每天早上开会核对前一天的数据发现问题并提出报告改善） 3.统计模具生产数量-制作模具履历表-核查相关人员对模具是否做到定期保养。 总结：计划生产指令单-物料管理（申购与退料）-了角各部门不良进行急时处理-处理生产中出现的各种异常。\" 离职原因：私人原因 公司名：桐君逸品陶瓷有限公司工作时间：2014年11月至2015年8月辞工原因：生育。 担任：总经理助理 安排生产，制作生产计划并跟进生产，处理生产异常，以及总经理交代的其它事物进行跟进并处理。||我性格属于直性子比较强势，因为只有这样能看见不一样的自己，对工作的付出及努力很享受领导的赞扬因为它会增加我的上进之心. 工作中我对别人很严肃（在他犯错的情况下），业余时间我很开朗，因为严肃中也需要欢乐劳逸结合才能把工作做的更好. 我希望我下一个公司是充满欢乐，环境偏优美这样工作中遇到不愉快也可以令人舒缓心情.', '2004年9月-2007年6月 | 赣南科技应用学校 |文秘与财务管理 中专', '', '', '');
