INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '钟先生', '29', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/1021028x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn2/', '2016-11-01', '非盈利机构；政府/公共事业；教育/培训/院校', '定南县', '大专', '', '', '', '', '', '面议', '', '佛山市顺德区乐从智慧城镇发展中心 工作时间： 2012年9月-2015年5月 在职职位： 综合部副部长+项目运营部副部长 所属行业： 非盈利机构 工作职责： 3.本人在发展中心任职两个职位：任职综合部副部长一职（办公室主任），主要负责人事行政管理，配合各部门对人员缺口进行招聘，做招聘计划，对入职员工进行入职及相关的技能培训，后勤保障，办理合同手续，住宿手续，离职手续；中心或部门活动的组织及策划等等。项目运营部副部长一职（类似于PMP项目管理师），主要负责乐从智慧城镇建设项目的运营管理，从项目的调研、可行性分析、立项、招投标，到合同签订，到项目计划的制订及实施，进度的管理，风险的管控，各方的协调，后期的试运行及验收等工作，下属有四人，两位助理，一位监理，一位文员。 主要成就：1、编制了发展中心《关于智慧乐从建设项目管理办法》、编制发展中心规章制度和体系及编制智慧城市建设项目验收表格模板（80多个）；2、编制了《国家关于乐从智慧城市建设乐从模式项目流程图》（已交住建部）；3、两年任期内，共有八个国家智慧城市项目落地并成功验收，如智慧安监巡检、智慧电梯、智慧社区、智慧医疗、智慧校园、政府民生WIFI项目及APP项目、智慧内河涌监测等；（乐从新闻及报纸可查。）。4、政府工作会议的安排，会议纪要的编制，政府分管智慧城市建设项目的工作报告的编制。5、等等。||定南县人民医院 工作时间： 2015年6月-2016年5月 在职职位： 信息员 所属行业： 企事业单位 工作职责： 1、负责协助医院办公室工作 2、负责信息科日常工作。||本人专业为计算机类和公共关系管理类，毕业后所经历的两份工作，皆是两个专业共同兼任，即偏向综合管理类，既有电脑软件类的技术管理类，也有对企业管理以及行政管理，在以往的工作中，个人得出一个结论，就是任何企事业单位，任何项目的成功，离不开对人员的管理和分配，人事行政管理，对人员的管理，是一个企业的根本，是不可或缺的一部分。所以在本次找工作中，本人的求职意向为偏向综合管理方向的岗位，本人觉得在工作上有以下优势： 1. 性格开朗随和，沟通能力强，待人热情，做事勤奋认真，善于合作，吃苦耐劳，适应能力强； 2. 有较强的学习能力和动手操作能力，做事主动性强，能承受较大的工作压力（包括在外出差等等）； 3.遇事善于提出各种解决方案，努力做到“今日事今日毕”。', '2006年8月-2009年6月 | 珠海城市职业技术学院 |计算机科学与技术 + 行政管理,2007年7月-2008年12月 | 广东南方软件学院 |软件开发及项目管理', '', '', '');
