INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '古祖贱', '53', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/1020784x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn2/', '2016-11-01', '2000', '江西', '初中', '', '', '', '', '', '面议', '', '本人初中毕业之后在信奉煤矿工作，20年前下岗一直一直在广东打工，做过好的工作家具加工，玩具厂等，现回定南县城定居，想找一份保安的工作。本人是土生土长的定南人，对定南的比较熟悉 ，能吃苦耐劳 ，工作认真。', '', '', '', '');
INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '章淑虹', '27', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/1020655x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn2/', '2016-11-01', '看工作时间', '江西', '高中/中专', '', '', '', '', '', '面议', '', '2012/09至2013/1 深圳市时代云端科技有限公司  产品经理 深圳市时代云端科技有限公司是一个综合网站人力资源招聘服务公司，我主要跟踪“爱猎证”此网站的开发、网络宣传、推广等工作。 2009/06至2012/05 深圳市硕联人力资源有限公司  电话网络销售（大客户）深圳市硕联人力资源公司是一个提供行业细分人力资源网络招聘服务公司， 中国专业人才网（www.djob.com）定位于中国分行业人才招聘门户，是从事为各行业的企（事）业单位及人才提供招聘、求职的网上人力资源综合解决方案供应商。我在公司负责的网站是电力专业人才网行业性招聘网站，主要利用电话网络与企业HR沟通，从而达成合作关系。协助HR选择合适网站，招聘合适人员，包括中高端猎头方面的职位。负责网站推广。了解市场各个招聘渠道，了解实时市场招聘渠道的价格。我们一般上班除了会给客户打电话，开发客户外，还有做一些相应的推广，所以对网络这块有一定的了解！在硕联将近3年，销售是个累积的过程，09年半年业绩一直不稳定，10年才稳定业绩完成公司对我的考核，至直11年才有突破，11年获得全公司全年业绩销售冠军，同年其中有4个月获得业绩销售冠军。12年在走的前几个月也都完成了公司的考核。做到善始善终。对客户认真负责服务了3年，赢得了众多客户的好评。这是我第一份业务工作，感觉很吃力，很辛苦，3年下来感觉自己成长了很多很多！', '', '', '', '');
INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '龙小姐', '25', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/1020052x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn2/', '2016-11-01', '人事', '赣州', '大专', '', '', '', '', '', '面议', '沟通能力强,执行力强,学习力强,有亲和力,责任心强', '深圳大力神科技有限公司 工作时间： 2013年2月-2013年12月 在职职位： 人事行政 所属行业： 电子 工作职责： 工作描述： 1：员工的考勤制作 2：采购办公室物品 3：人员招聘、初试 4：人事档案的建立 5：员工的入职、转正、离职的手续办理。 6：制定规章制度 7：社保 8：客户接待 9：员工宿舍的安排和管理 10：员工食堂的安排和请款 11：公司原材料的采购||广州众木成林商贸有限公司 工作时间： 2014年2月-至今 在职职位： 人事行政主管 所属行业： 快速消费品 工作职责： 工作描述： 人事工作内容：1：招聘人才和初试、员工档案的管理。2.负责公司人事管理工作，完善人事各类报表；3.负责员工入职，转正，晋升，离职等流程的执行；4.落实公司内部的沟通机制，及时跟进反馈员工的思想动态；5.负责员工的五险的购买及纠纷；6.负责公司与员工签订劳动合同及处理纠纷；7.丰富公司企业文化，提升企业向心力。 行政工作内容：1：考勤和管理办公室的规章制度。2：新员工的培训、员工关系管理3：绩效考核、薪酬福利、岗位职责的编写。4：采购办公室物品。5：预订机票和酒店。6：负责公司固定资产(包括办公设备、办公用品)的管理工作，包括清点、维护、登记等。7：行政接待及会议室管理，编写内部行政或人事通知。8：汇总考勤、计算提成、奖惩管理。9：保管公司行政类材料档案、办公物品以及定期维护更新固定资产并更新表格。10：领导交办的其他工作。在这份工作中我得到了老板的认可且多次在会议室开会表扬我，并且在2015年3月份升职为公司的人事行政主管。在这份工作中我也学习到了很多。很感谢这份工作给自己带来的收获，让自己又成长了一些。||1、有三年多的人事工作经验,擅长招聘、员工关系、行政事情 2、熟悉各大招聘渠道，善于筛选匹配的简历 3、具备很好的分析定位、面试甄选能力、沟通协调能力和执行力 4、善于自我管理学习，适时会提出一些招聘建议，并能及时被采取。 5、我个人工作比较有条理性，具高度责任心、敬业；性格乐观，也有较高的团队合作精神、进取心、能吃苦耐劳、积极、耐心、谨慎、自制力。有志于从事人力资源。', '2010年9月-2013年7月 | 江西现代职业技术学校 |旅游管理', '', '', '');
