INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '张建军', '34', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/1014134x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn3/', '2016-10-08', '业务员司机', '江西', '初中', '', '', '', '', '', '面议', '诚信正直,有创业经历', '有8年的工作经验，驾驶技术熟练，对车的保养及一般维护熟识，爱惜车辆;具有高度的敬业精神与团队精神。 严格按照各项规章制度，坚守工作岗位，不迟到，不早退，不误事，不无故缺勤，做到随叫随到，服务调度，听从指挥，自觉维护单位和个人形象。 能吃苦耐劳，踏实肯干，与同事相处融洽，服从命令，尊重领导;本人性格开朗、谦虚、自律、自信。 熟悉本县城交通路线。现希望能在本县城从事工作，方便照看家庭， 从事过业务员，铲车司机，B2驾照货车司机，现有商务小车一辆，可带车工作。符合贵公司老板要求的可以联系我！', '', '', '', '');
INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '冯雪连', '26', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/1013795x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn3/', '2016-10-08', '人事、行政、办公室文职类工作', '江西定南', '大专', '', '', '', '', '', '面议', '学习力强,有亲和力,诚信正直,责任心强,沉稳内敛', '深圳市高力特实业有限公司 | 工作时间： 2010年10月-2012年3月 在职职位： 行政专员 所属行业： 其他 工作职责： 1、负责员工的考勤，于次月第一个工作日提供考勤报表并存档； 2、负责员工档案管理，包括原始档案的收集、整理、归档、电子档案的建立； 3、对一般文件的起草和行政人事文的管理； 4、依据人力资源要求计划，组织各种形式的招聘工作、收集招聘信息，协助招聘工作； 5、处理人事日常管理工作，负责请假、招聘、录用、保险、合同等人事手续的办理； 6、及时办理相关证件的注册、登记、变更、年检等手续；协助做好公司人力工作的管理、培训与指导； 7、组织公司各种活动的策划； 8、负责办公用品采购计划制定及物品领取管理||深圳图治财务顾有限公司 工作时间： 2012年4月-2015年4月 在职职位： 人力资源专员 所属行业： 财务行业 工作职责： 1、负责公司人事招聘、面试资料的整理及保管，发布公司通知，拟定规章制度等； 2、新员工入职培训、签署劳动合同、讲解公司规章制度等； 3、完善及协助员工办理离职手续等； 4、公司日常办公用品的采购，兼职采购其他产品等； 5、负责公司全体员工考核设计及每月考核统计、分析工作； 6、办理员工社保的购买、薪酬的计算及福利的发放等； 7、发票报销填开等； 8、网络等相关工作； 9、做好材料收集、档案管理、公文制定、文件收发等工作 10、负责公司传真机、复印机、电话等办公设备的日常管理和维护 11、领导交代的其他工作任务。||为人乐观积极，待人真诚和善，善于与人和睦相处，热爱生活，对工作充满干劲和激情，五年的工作经历，积累了丰富的工作经验，具备独立工作的能力及良好的团队协作精神。做事沉稳，高效，工作态度高度认真负责，敢于担当，抗压能力较强。', '2007年9月-2010年7月 | 北京工商学院 |人力资源管理', '', '', '');
