INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '魏满娥', '31', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/964371x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn12/', '2016-06-07', '采购员，跟单员，出纳，文员', '江西安远', '不限', '安远高中', '--', '会计/出纳/收银员', '定南', '8年以上', '3000-4999元', '沟通能力强,学习力强,有亲和力,诚信正直,责任心强', '江西省定南县政府接待（定南宾馆）0797-4232 工作时间： 2009年5月-2014年10月 在职职位： 财务职员 所属行业： 政府接待 工作职责： 1、主要负责每月审核各单位的帐目及收款等……工作。 2、统计餐厅部与客房的营业情况。 3、每月县属单位及四套班子报表工作。 4、每月做好统计局的统计报表上报工作。 5、每月税款缴纳工作，网上上报工作. 6、工资表制作于人事进出的管理用内部系统的管理工作.||乾鑫电器设备有限公司 工作时间： 2007年11月-2009年4月 在职职位： 采购员 所属行业： 国家电网 工作职责： 1、主要负责采购高低压柜体、塑胶、各种断路器、五金、电器元器件及配件、各类用品及办公用品等，熟悉并优化本公司的采购流程，并成功控制采购成本质品及其时间。 2、接到生产材料单及采购申请单订购相应物料，采购计划单的制作与发放以及采购，包括询价、比价、议价、洽谈付款方式、采购合同的制作以签订、确认、及时跟进货到日期。 3、执行采购订单与采购合同条约,并执行所购物资的质量检验、确保质量合格，并处理不良产品及时补救,及时与供应商的沟通，确保生产进度不受影响对新工厂的诚信度、资历以及规模等相关信息的核实，必要时验厂。 4、资料的归档与整理，发票的追踪与登记、每月对帐与申请供用商付款||特浦文体包装(深圳)有限公司 工作时间： 2006年9月-2007年11月 在职职位： 跟单员 所属行业： 办公用品 工作职责： 1、主要负责处理客户订单，下达生产通知单，排单,跟进生产进度,回复客户交期，ERP系统的下达及打单，安排出货，跟催货款，处理订单异常事件。 2、主要负责:PETG,GAG,APET,PP原板的销售及丝印、柯式印刷加工、文件夹、相册、资料册、办公用品等,,,业务。||南京市欧宁工艺外贸有限公司 工作时间： 2004年2月-2006年9月 在职职位： 经理助理 所属行业： 外贸 工作职责： 主要负责客户需求样品开发的按排及制作、跟进、回复、及采购布料、花边，织带，工艺配件，等…..办公室工作。||作积极认真，细心负责，熟练运用办公自动化软件，具有较好的内外协作能力，有八年以上工作经验。善于在工作中提出问题、发现问题、解决问题，有较强的分析能力，对企业行政管理有较为丰富的经验和独到的见解。', '2000年9月-2003年7月 | 安远高中 |文科', 'http://p4.pccoo.cn/post/20160607/2016060710120826570373.jpg', '', '');
