INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '黄清', '25', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/862521x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn15/', '2016-04-19', '销售/导购/管理', '汉', '大专', '', '', '', '', '', '3000-4999元', '沟通能力强,执行力强,学习力强,有亲和力,善于创新', '北京汇源有限食品有限公司 工作时间： 2014年10月-2016年2月 在职职位： 片区经理 所属行业： 饮料 工作职责： 1.建立良好的厂商客情关系，让他们树立一种信念：“我是厂家的经销商” 2.了解市场价格情况，有无乱价和窜货情况。 3.传达公司的最新精神。 4.初步了解竞争对手的最新动态：销售情况、价格变化、新产品、销售政策、通路渠道、广告投入及促销活动等.及时掌握经销商的意见反馈，新产品的销售效果、产品质量、代理商配送货是否及时、积压滞销品是否需要调换、售后服务问题等。 5.市场巡视一星期走访一次所在地零售终端。了解终端现尝销售情况和竞争品牌动向。与店铺老板、大商场家经理、柜长沟通。解决他们销售中出现的实际困难，如售后服务、老产品和积压品的消化活调换。||我性格开朗、思维活跃;拥有年轻人的朝气蓬勃,做事有责任心,条理性强;易与人相处,对工作充满热情,勤奋好学,敢挑重担,具有很强的团队精神和协调能力。在为人方面,我诚实善良、开朗自信,能够吃苦。在生活中,我尊敬他人,能够和别人友好相处,现在我唯一的不足就是应届毕业,还没有足够的工作经验。但我擅长快速学习新知识,并且对工作有高度责任感,能够全身心的为工作奉献。所以,希望您给我这个机会,我有充足的信心在很短的时间内胜任这份工作,成为公司未来发展的好帮手,谢谢。', '', '', '', '');
