INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '叶国权', '23', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/939491x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn16/', '2016-04-02', '业务代表，营销策划，电子商务', '江西赣州', '大专', '江西应用科技学院', '工商企业管理', '市场公关/广告会展', '江西省赣州市定南县工业大道53号背后', '1-3年', '面议', '沟通能力强,执行力强,有亲和力,责任心强,善于创新', '深圳乾德电子股份有限公司（启东分公司） 工作时间： 2013年10月-2014年4月 在职职位： 注塑特精课课员 所属行业： 计算机电子 工作职责： 工作内容：负责手机连接器，电脑连接器，电池连接器等连接器原件产品的注塑工艺，以及产品的测试。||深圳市宏祺科技有限公司 工作时间： 2014年8月-2015年12月 在职职位： 业务员 所属行业： 电脑周边产品 工作职责： 运营阿里巴巴中国站，国际站，开发新客户，维护老客户，并且建立二次营销系统，运用CAD等绘图工具，参考客户来样，研发和绘制客户需求的产品图纸，并打样确认和发给客户审核。||我若成为公司的一名员工，我会对同仁如伙伴，互尊互敬，保持良好的沟通，使大家成为合作团队；对工作抓住重心，沉着冷静，及时发现问题，做出最快最优化的反应，尽快解决问题；运用计划、领导、组织、协调、控制等基本职能，使自己能尽快融入企业，为企业做出贡献；对企业如自己，企业形象就是自身形象，维护企业形象，传承优良的企业文化，起到模范作用！', '2011年9月-2014年7月 | 江西应用科技学院 |工商企业管理', 'http://p3.pccoo.cn/post/20160402/2016040223275751426400.jpg,http://p3.pccoo.cn/post/20160402/2016040223281050824062.jpg,http://p3.pccoo.cn/post/20160402/2016040223281440988284.jpg,http://p3.pccoo.cn/post/20160402/2016040223281576150249.jpg,http://p3.pccoo.cn/post/20160402/2016040223281853675585.jpg', '', '');
