INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '杨保华', '31', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/837557x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn16/', '2016-03-30', '总经理助理.人力行政总监,人事行政经理', '江西定南', '大专', '北京经济管理学院', '人力资源管理', '文员/后勤/人事', '公园华庭', '8年以上', '8000-11999元', '沟通能力强,执行力强,有亲和力,责任心强,沉稳内敛', '兄弟鳄鱼（中国）鞋服有限公司 工作时间： 2006年4月-2010年4月 在职职位： 人力资源部经理 所属行业： 鞋服 工作职责： 1、根据企业的发展情况提出人员招聘计划。 2、负责人力资源六大模块管理工作。 3、各部门员工职业技能培训和员工活动策划等。 4、负责员工的绩效考核和新酬设计等。 5、制订修订及执行人力资源制度与政策、整合人力资源管理体系。 6、组织开展企业文化建设，贯彻落实企业管理理念和价值观。 7、制定年度、季度招聘规划，并负责组织实施。 8、负责人力成本及行政后勤成本的管控。 9、熟悉商务谈判和部门与部门之间的沟通。 10、对政府的办事流程比较熟悉。||鳄莱特集团 工作时间： 2010年4月-2014年2月 在职职位： 总经理助理 所属行业： 鞋服纺织 工作职责： 1、协助总经理制定完善企业的规章制度及企业价值观。 2、协助总经理负责运营中心的品牌管理及订货会召开。 3、协助总经理制定年度战略及品牌推广。 4、组织召开公司高层管理行政会议。 5、安排集团总裁与及总经理的日常行程。 6、接待上市组审计以及审计人员的行程安排。 7、协助分公司验厂及体系认证服务。 8、指导各分公司每半年固定资产盘点及账目核对。 9、实施厂区6S管理体系认证及外联工作。 10、审批各类文件及接待政府部门人员。||益进实业香港有限公司 工作时间： 2014年2月-至今 在职职位： 人力行政总监 所属行业： 鞋服纺织/互联网 工作职责： 1、负责整合人力资源六大模块管理工作。 2、制订修订及执行人力资源制度与政策、整合人力资源管理体系。 3、组织开展企业文化建设，贯彻落实企业管理理念和价值观。 4、制订公司长期发展战略。 5、起草修订企业的规章制度并运行实施。 6、协调企业和政府部门的内部关系。 7、执行总裁办的日常人力资源事务。 8、接待政府部门，国外友人及投资者洽谈合作事宜。 9、审批各类文件及外联工作事项。 10、执行总裁，总经理临时交办的工作任务及事项。||在上市集团从事行政人力资源类工作8年以上经验，精通制造行业公司各方面人力行政管理事务，尤其擅长验厂、体系认证，上市组审计资料制作和接待。熟练人力资源管理工作的开展、对人资规划、劳资配置、培训开发、薪酬设计、员工关系、绩效考核、员工激励，和社会保障、档案管理等均有较深的心得；历任人力行政专员、人力资源部经理、总经理助理、人力行政总监等。科班毕业基层锻炼起来。对员工与组织之间的关系协调经验丰富；在设计员工的职业生涯和制度修订上有较强的能力；在企业文化建设上有丰富实战工作经验，本人语言表达能力强.普通话标准、知识结构全面，期待选择合适的平台体现个人价值。', '2003年9月-2006年7月 | 北京经济技术管理学院 |人力资源管理与心理学,2009年9月-2010年7月 | 泉州科技局 |人力资源管理师证书,2012年9月-2014年7月 | 泉州科技局 |职业经理人证书', 'http://p3.pccoo.cn/post/20150727/2015072712053043727514.jpg,http://p3.pccoo.cn/post/20150727/2015072712052728581565.jpg,http://p3.pccoo.cn/post/20150727/2015072712052836698239.jpg,http://p3.pccoo.cn/post/20150727/2015072712052776450032.jpg', '', '');
