INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '彭美园', '31', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/869025x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn26/', '2015-10-10', '文员', '江西九江', '大专', '', '', '', '', '', '面议', '沟通能力强,有亲和力,诚信正直,责任心强,阳光开朗', '福泽珠宝 工作时间： 2008年7月-2009年4月 在职职位： 店长 所属行业： 私有 工作职责： 主要负责每天的销售情况，尽量做到让每位顾客都满意。及整理每月的报表，盘点，补货。||珊笛服饰 工作时间： 2009年5月-2010年1月 在职职位： 跟单文员 所属行业： 私有 工作职责： 主要负责跟进厂房进度以及质量，能按时出货及达到客户的要求。协助车版师车版，接听电话等||伽其服饰 工作时间： 2010年3月-2010年9月 在职职位： 设计助理 所属行业： 私有 工作职责： 主要负责协助设计师审图，以及制作生产制单表，采购面料及辅料，排珠以及整理账单等。||虎门小学士幼儿园 工作时间： 2013年8月-2014年1月 在职职位： 幼师 所属行业： 私有 工作职责： 来园：1、检查活动室是否干净、整洁、安全。注意活动室的开窗通风，通过时间根据季节特点有所不同。2、面带微笑，接待幼儿来园，主动问好，使用礼貌用语“早上好”，做到“一摸、二看、三问、四查”。3、帮助孩子安置所带的衣物等，并向家长主动询问有无交接事宜，引导幼儿与父母道别说“再见”，愉快分离。||安琪儿现代幼儿园 工作时间： 2014年2月-2014年7月 在职职位： 生活老师 所属行业： 私有 工作职责： 每天早晨都做好开窗通风、清洁消毒的工作，配合老师做好晨间接待工作，并进行再次得晨间检查，有时我发现幼儿的口袋里和书包里放着一些玩具。安全在户外活动中，我也配合老师有组织有纪律的进行，确保幼儿的安全，同时还不断对幼儿进行安全教育，让幼儿知道什么地方是危险的，什么东西是不能玩的，怎样玩才不会危险，以提高幼儿的自我保护意识。||寻找合适的工作岗位，我将充分发挥以前工作中所积累下的丰富知识和技能，我的勤奋与努力会令你刮目相看。 我会努力做好自己的本职工作，以求更好的发展。', '2005年9月-2008年7月 | 江西旅游商贸职业学院 |服装设计与表演', '', '', '');
