INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '黄艺良', '26', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/823838x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn31/', '2015-07-15', '设计、送货安装', '江西定南', '大专', '江西电力学院', '模具设计与制造', '建筑/房产', '江西定南', '3-5年', '2000-2999元', '执行力强,学习力强,责任心强,雷厉风行,阳光开朗', '佛山市路创医疗科技有限公司 工作时间： 2010年11月-至今 在职职位： 技术部部长 所属行业： 制造业 工作职责： 工作描述： 2010.11－－2011.06：大学毕业，以实习入职，担任CAD绘图员一职，负责产品零部件图纸、工艺资料制作和输出。 2011.07－－2012.09：任技术员，负责新产品开发的结构设计图、BOM表的制定，技术文档发放，以及老产品改进、维护和优化。 2012.10至2015.05：任技术部部长，领导部门新产品开发，负责整体设计规划，图纸审核，样品、模具跟进，生产技术指导，完善技术开发。 2013.05至今：兼任管理者代表，负责质量管理体系建立、完善、实施以及维护，主导技术、品质、生产多部门对产品质量管控。||1. 拥有扎实专业基础，熟悉机械结构制图、CAD、Pro/E ;或;Solidworks、OFFFICE等。  ;2. 具有4年以上从事轮椅、马桶椅，卫浴康复器械等产品设计开发经验，熟悉结构和整体设计流程，能独立完成设计方案。 3. 3年部门管理和项目管理经验，有良好团队管理、工作规划能力。 4. 2年管理者代表经验，熟知ISO13485质量管理体系流程，有文件、预案编制和实施经验，质量意识较强。 5. 具备较好的沟通、协调能力，高度的责任感和团队意识，能够承受压力，敢于创新。 6.持电工证，专业技能证，C1驾照，四年驾龄', '2008年9月-2011年7月 | 江西电力职业技术学院 |模具设计与制造,2013年5月-2013年6月 | 职业培训 |ISO13485管理体系培训', 'http://p3.pccoo.cn/post/20150630/2015063014192779997577.jpg', '', '');
