INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '刘吉莉', '27', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/821750x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn32/', '2015-07-01', '办公类', '--', '大专', '深圳大学', '会计', '文员/后勤/人事', '--', '3-5年', '2000-2999元', '沟通能力强,学习力强,有亲和力,诚信正直,责任心强', '深圳市金士吉科技有限公司 工作时间： 2010年6月-2013年4月 在职职位： 招聘培训专员 所属行业： 健康用品 工作职责： 工作职责： 1、负责公司的内外部招聘：配合人力资源部经理进行工作分析，制定、完善各岗位的职务说明书，做好人力资源规划；完善公司的内外部招聘制度，做好人力资源信息的收集、整理、储备；负责制定、完善公司员工手册；负责制定公司的内外部招聘计划，发布招聘消息，并组织实施招聘；负责制定、完善面试组织程序及应聘者考核办法与标准；负责提出人员内部选拔、调动的建议，经批准后，组织实施；负责员工试用、转正的考核登记工作；负责招聘费用的控制。 2、负责公司人力资源的培训与开发：制定、完善公司的培训制度及相关细则，制定长期和短期培训计划；负责制定员工职业生涯发展规划；负责组织实施新员工培训、部门交叉培训、通用类外部培训和专业类外部培训；负责对各部门的内部培训给予指导；负责办理员工长短期教育的相关手续；负责对培训和教育的需求进行评估，对培训和教育的效果进行评估；负责培训、教育费用的审核与控制；负责员工职称评定，工人技能鉴定，特种作业人员操作证办理。 3、完成人力资源部经理交办其它各项任务。||浙江宏途交通建设有限公司 工作时间： 2013年5月-2014年6月 在职职位： 资料员 所属行业： 交通建设 工作职责： 工作职责：工程资料制作。||本人性格开朗、为人诚恳、乐观向上、工作勤奋，认真负责，能吃苦耐劳，尽职尽责，有耐心，拥有较强的组织能力和适应能力。', '2011年3月-2013年3月 | 深圳大学 |会计', 'http://p3.pccoo.cn/PHpost/20150626/2015062612165394324731.jpg', '', '');
