INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '陈华珍', '36', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/235885x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn41/', '2015-01-23', '办公室主任', '定南人', '本科', '', '', '', '', '', '面议', '', '2008年4月至今 从公司筹建到正式投产，蓝图、合同、资料管理，通知、红头文件、报告的下发，新设立及派生分立公司、对外协调接待及公司各项会议的主持记录，党支部、工会等组织成立，人事招聘、广告宣传、画册设计、电脑和网络的维护、制度制定、证件办理年审、培训、考勤统计、食堂、保卫管理等。 2007年2月－2008年4月在广州、深圳工作。||有较强的组织、协调和管理能力，具有团体精神，能吃苦耐劳，有上进心，并有良好的文学修养，能灵活运用计算机的一些软件，想找一个发挥我才能的舞台。如果我能到贵公司，定为公司的发展而努力奋斗！！！', '', '', '', '');
INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '魏林', '39', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/233855x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn41/', '2015-01-23', '外地归来真诚求职某项职位请联系我', '江西定南人', '不限', '', '', '', '', '', '面议', '', '1：在校期间积极参加社会实践县公检法实习期间获多次好评 2：毕业后在南昌南京西路国美电器任安保副主任获员工大区奖励 3：离职后3年随企业在江西、山西、广西、福建等地负责工地管理、采购、业务等事务，负责大型搅拌站生产全面管理均创造大幅盈利||顾家谋事业 能适应出差 6年无安全事故10万公里C1驾龄 电脑文字组织 表格均会', '', '', '', '');
INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '刘庚', '25', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/233853x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn41/', '2015-01-23', '勤劳和聪明是同时的', '江西赣州市定南县人', '不限', '', '', '', '', '', '面议', '', '我18岁高中毕业，之后在深圳工作，有做过厨房，龙华富士康，服务行业里管理的经验，最久的是在一家广告公司上了两年班，有学过平面设计，在这家公司，我担任的是副经理一职，有采购的经验和准确的判断力，选择最有效率的方案为公司争取荣誉||我为人诚恳，做事踏实，有上进心，头脑灵活，有一定的洞察力和执行力，接受能力和学习能力强，对于现在的我来说，我愿意从各方面做起,我把希望寄托在我的工作和生活当中，充实的生活就是我们时时刻刻都在学习，所以，我希望我能找到一个属于自己的和适合自己的发展平台，', '', '', '', '');
INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '唐琪', '26', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/233753x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn41/', '2015-01-23', '决定长期呆老家，所以想找一份稳定的工作', '定南', '大专', '', '', '', '', '', '面议', '', '2012/02-2012/08：江西联创电子有限公司，检验，检验LENS的良品与不良。 2011/11-2011/12：置业顾问,因为没做多久,刚接触房产,所以学习沙盘介绍,销售素质等. 2010/06-2011/09：促销,向各个餐饮，零售，超市，酒店等推销“四特酒”。 2008/06-2008/09：每日按规定时间到公司出纳处交清前一天的营业款项及报表。 2008/02-2008/05：服务员,偶尔前台接待，期间学到很多，微笑，礼貌，谨慎。||开朗乐观，有亲和力，有责任感，认准的事情很少会改变或气馁，做事深思熟虑，信守承诺并值得信赖。 适应能力强，自信。 做事或做某种决定前先充分收集各种信息，然后根据信息去综合考虑实际的解决方法，而不是运用理论去解决。我对细节非常敏感，有很实际的判断力。 也是一个很典型的天平座', '', '', '', '');
