INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '赖洁耀', '23', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/670466x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn42/', '2014-11-21', '设计', '定南', '大专', '', '', '', '', '', '2000-2999元', '执行力强,学习力强,诚信正直,责任心强,善于创新', '定南盛凯威实业有限公司 工作时间： 2014年2月-2014年6月 在职职位： 实习生 所属行业： 建筑 工作职责： 实习期间主要是协助甲方总工检查和监督每个进度每项工程的安全以及质量，还跟放线员一起放线。在和期间还解决了协调混凝土调运的问题。帮助总工更好地完成工作。每天都在现场跟施工员监理一起对现场的质量安全进行监督和检查，还写好施工日志记录当天存在的问题，以及遇到不懂问题及时问现场的工作人员或者问总工。在这期间我也帮助了他们放线组把1号楼全部线都放好。||本人综合素质佳，能够吃苦耐劳，忠诚稳重坚守诚信正直原则，勇于挑战自我开发自身潜力； 做一个主动的人，工作积极热情，为了自己的目标为了完成自己想要的事情拼命投入力量； 具备良好的人品，乐于与人沟通，生活在群体之中，能够与人进行客观直接的沟通，具有较强的团队管理能力和与人合作的精神，能够积极互动努力达成团队的目标； 善于学习，勤奋务实，刻苦钻研，具备广泛的兴趣和很丰富的知识，适应能力强，能够在很段时间内融入一个新的领域，适应他并且把他做好。在竞争中学会从容,在挫折衷学会微笑；做最坏的打算,尽最大的努力.我相信这样的人生就会是胜利的人生。', '2011年9月-2013年11月 | 江西应用技术职业学院 |工程造价', '', '', '');
