INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '叶腾芳', '26', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/569491x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn44/', '2014-05-28', '业务员', '江西定南', '大专', '', '', '', '', '', '面议', '', '■深圳捷利宝实业有限公司 公司类型：私营企业 担任职务：督导业务员 工作描述1、负责公司产品的销售及推广； 2、根据市场营销计划，完成部门销售指标； 3、每日实时根据商情管理系统查询前日销售数据、库存占比、滞销动销情况，对相关货品进行下单要货或退返；； 4、负责辖区市场信息的收集及竞争对手的分析； 5、负责销售区域内销售活动的策划和执行，完成销售任务； 6、管理维护客户关系以及客户间的长期战略合作计||本人性格开朗，善于与人沟通，与同事相处融洽，有良好的团队和合作精神。在从学校毕业后，从事了半年的市场营销工作，并从中得到了丰富的工作经验,尤其在与人交流方面得到了很大得提高；同时培养了刻苦耐劳的精神，能适应各种工作环境及承受较大的工作压力。处事果断，能认真的完成各项工作。', '', '', '', '');
INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '廖佳龙', '28', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/608572x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn44/', '2014-05-21', '销售类', '龙南', '大专', '江西青年职业学院', '计算机网络技术', '销售/导购/业务员', '定南', '5-8年', '面议', '执行力强,有亲和力,诚信正直,责任心强,阳光开朗', '全利集团勤业工业（龙南）控股有限公司 工作时间： 2009年11月-2013年12月 在职职位： 技术员 所属行业： 计算机 工作职责： 维护公司电脑，组装电脑、维护网络和硬件设施、域控服务器、文件服务器，维修UPS键盘鼠标基础电脑设施，管理公司停车场系统。||联想专卖店（金威科技有限公司） 工作时间： 2007年12月-2010年9月 在职职位： 技术员 所属行业： 计算机 工作职责： 维护公司所卖的联想电脑和常用硬件设备，提供联想售后服务组件电脑以及上门维护工作，维护其他公司的网络和电脑，提供网络和软件方面的解决方案||对待工作认真负责，善于沟通、协调有较强的组织能力与团队精神；活泼开朗、乐观上进、有爱心并善于施教并行；上进心强、勤于学习能不断提高自身的能力与综合素质。在未来的工作中，我将以充沛的精力，刻苦钻研的精神来努力工作，稳定地提高自己的工作能力，与企业同步发展。', '2004年9月-2008年7月 | 江西青年职业学院 |计算机网络技术', 'http://p2.pccoo.cn/post/20140415/201404151904088065.jpg', '', '');
