INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '黄燕红', '28', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/610617x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn45/', '2014-05-10', '行政文员、文职/助理类、销售员、导购员', '定南', '高中/中专', '', '', '', '', '', '面议', '沟通能力强,有亲和力,诚信正直,责任心强,阳光开朗', '中山莱利灯饰股份有限公司 工作时间： 2007年8月-2009年10月 在职职位： 文管、统计 所属行业： 灯具类 工作职责： 文管主要负责：文件的上传下达，工程式资料的管理及修改和文件发放等。由于其间对工作的认真负责受领导常识被指派到生产车间任统计一职，主要负责：各类报表的制作、工资的核算、考勤及月总结报告类。离职原因是：想换个工作环境。||深圳市浩鹏科技有限公司 工作时间： 2009年11月-2010年12月 在职职位： 采购、行政文员 所属行业： 手机类 工作职责： 采购主要负责：订购油漆、文具、对账及保管资料等杂事。行政主要负责：招工、吃住按排、算员工考勤、等杂事。账目主要负责：记录公司所有发生金额的流水账、算员工工资、整理经理所以关报销单据并且把所有关账目提供给老板等杂事。离职原因：因公司产量不太好并且资金周转不过来所以倒闭。||江西赣州市定南县定南金汇汽贸有限公司 工作时间： 2011年1月-2011年3月 在职职位： 销售顾问 所属行业： 汽车类 工作职责： 销售各大品牌汽车||勤业工业（龙南）有限公司 工作时间： 2011年3月-2013年7月 在职职位： 后勤文员 所属行业： 玩具类 工作职责： 负责公司的后勤工作，安排公司各部门的报餐就餐人数统计，负责后勤部人事考勤和整个部门的工作报告等等。辞职原因：生宝宝的时间将至。||热情随和、活泼开朗，具有团队合作精神，有较强的动手能力，良好协调沟通能力。适应力强，反应快、积极、灵活、爱创新、及不断学习提高自己以适应工作的需要。拥有一定的沟通能力、熟练操作计算机办公软件，可独立完成公司布置的各种文职工作，能够面对任何困难和挑战。    我希望找下份与自身知识结构相关的工作，如文员、助理及有较大发展空间的职位，诚挚的希望能为贵公司的发展贡献我的微薄之力。', '2004年9月-2007年6月 | 定南高中 |计算机应用', '', '', '');
INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '陈财玲', '25', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/590331x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn45/', '2014-05-10', '文员、人事', '江西', '高中/中专', '', '', '', '', '', '面议', '沟通能力强,有亲和力,责任心强,阳光开朗,有创业经历', '深圳三普星科技有限公司 工作时间： 2010年12月-2012年6月 在职职位： 文员 所属行业： 电子 工作职责： 负责办公室日常电话、访客、信访的接待工作。负责收发处理各种函电、邮件和文件等。完成会务安排、接洽工作，必要时做好会议记录和纪要，以及拟写通用文案和一般工作报告。做好公司内外事务的安排和联络工作，还有文书档案收集、整理、归档和管理工作。管理和合理使用好电脑、打印机、传真机、复印机等办公设备.||1.热情随和有亲和力，自信勤奋上进稳重自学能力强，具有进取精神和团队精神，有较强的动手能力。 2.良好协调沟通能力，适应力强，反应快、积极、灵活，爱创新!提高自己，适应工作的需要。 3.已经有近四年工作经验的我，能够承担各种工作上的压力，有独立的思维方式，办事效率高，希望能够找到一份自己能让自己有所收获的工作，实现企业与个人的双赢。 4.熟练操作Word、Excel、PowerPoint等办公自动化软件。', '2006年9月-2009年6月 | 江西新余中山学院 |计算机', '', '', '');
