INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '黄丽芬', '29', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/566432x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn45/', '2014-04-08', '文职类', '定南', '大专', '', '', '', '', '', '2000-2999元', '', '2011年8月―2013年12月深圳华星光电技术有限公司助理工程师 工作职责：1、量产品TOP3不良品解析。2、接收外部门送样分析，给外部门提供真实有效的数据。3、解析结果的权别判定。4、解析数据、报告整理。5、将发现的问题反馈给工厂并跟踪其改善效果，辅助改善产品良率。6、协助部门主管完成其它事物等。 2011年4月―2011年7月深圳芯瑞迪微电子有限公司任项目助理 工作职责：1、工程项目前期准备工作，并与各部门之间沟通处理相关的事宜。2、工程项目管理、报告处理、沟通协调和日程安排，以及完成相关的日报事宜。3、协助主管做好分包工程项目清单价格核算及归档；分包商工程款申请的前期工作处理。4、维修事宜的安排以及维修结果的追踪。辅助完成设计项目、样机测试等。 2010年2月−−2011年3月合肥京东方光电科技有限公司任SQE助理工程师 工作职责：1、产线材料品质issue处理；产品品质状况的跟进，处理客户投诉及制定临时改进措施；2、对于产线突发不良，及时确认；将问题反馈给供应商，跟踪并确认改善效果。3、产线材料不良复判，推动供应商材料不良改善；4对确认的不良品进行分析，指导检查员检查的侧重点。5、跟踪新材料评价过程，配合开发部门解决新产品导入阶段的品质问题。||本人性格开朗、为人诚恳、乐观向上，拥有较强的工作适应能力和责任心，善于不断学习及总结，吸收能力强，有较强的创新意识和团队合作精神，本着认认真真做人，踏踏实实工作的原则去生活。', '', '', '', '');
