INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '缪剑锋', '27', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/583698x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn45/', '2014-03-19', '置业顾问', '江西省定南县', '大专', '江西省定南职业中学', '电子通讯', '销售/导购/业务员', '--', '8年以上', '面议', '', '2007-11应聘于巨基电子维修工程师职位，主要负责SMT生产测试段不良品进行维修及工艺分析。 2008-3公司扩展组装事业部，公司领导安排我到手机组装部负责工程，主要负责手机组装新产品导入产品缺陷分析、总结试产报告沟通客户逐步改善不断优化产品结构解决手机生产问题,负责手机的组装和加工工艺流程,作业指导书制作和结构产品BOM制作并与供应商联系处理不良物料。 2009-6公司导入自主研发产品，我主要负责项目生产跟进进度产品电子料结构料适配确认和产品结构分析和软件测试，不断优化结构提高生产效率。 2010-11公司产品步入收尾阶段，我又从组装部调入公司董事长项目助理，主要协助软件工程师调试硬件，整机结构改善进度跟进，并负责售后不良主板的维修和管理工作。 2011-3公司SMT事业部产线扩建，由原来的6条生产线扩建至20条富士NXT2生产线，公司领导安排我到测试部，以测试工程师领班的身份切入测试部，参与测试工程部内部管理，主要负责测试工程的管理工作、新产品跟踪导入、测试设备生产异常处理。 5月由于产线增加、出货加剧，我又以测试生管的身份（测试计划）安排测试生产运作和出货协调，并负责测试部创新改善负责人，主要组织资深测试工程师优化测试作业流程，硬件设施改动，主要导入了测试流水线和自动化测试两个优化项目工作供公司领导采纳， 11月测试人员变动，我以测试部经理的身份全面管理测试部运作至今。 2014.2月因公司倒闭转型。||本人曾在多家通讯企业工作，担任测试部经理、维修工程师，组装工程师及等职务。目前在SMT贴片担任测试部主管职务，全面管理生产及技术测试内部人员。具有丰富的工作经验，对手机加工SMT、组装、售后流程十分熟悉，对手机主板维修，测试设备调试维修都有过硬的技术基础，对工作认真负责工作积极主动、处理事务及沟通能力能力较强、电脑熟练。 我有着热诚学习心态和吃苦耐劳的干劲！', '', 'http://p1.pccoo.cn/post/20140311/201403111746482243.jpg', '', '');
