INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '吴珍', '31', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/568405x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn45/', '2014-02-22', '文员、出纳、会计助理', '汉', '高中/中专', '--', '--', '会计/出纳/收银员', '--', '3-5年', '2000-2999元', '', '2003-2005年广州津晖电子厂三年中任职品检一年，因工作表现好调入采购部任职文员一职 2006-2007年广东永泰和汽车用品有限公司二年中任职过文员一职，因工作中认真负责又好学调入会计部门任职统计员一职工作一年半 2008-2012年广东百匠座椅有限公司四年中任职客服文员一年，客服助理二年，出纳一年||本人热情大方、积极踏实、工作认真负责，有很能够好的适应能力和组织协调能力，具有强烈的责任感和事业心。 期待贵司给予机会，若被录用，我一定遵宁公司各项规章制度，兢兢业业、认认真睦完成各项工作，尽最大努力和智慧致于贵公司的繁荣和发展。 相信我是您的正确选择！！！', '', 'http://p1.pccoo.cn/post/20140222/201402220937267198.jpg', '', '');
