INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '张泽', '25', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/235883x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn46/', '2014-02-17', '求职家教工作', '江西定南人', '本科', '', '', '', '', '', '面议', '', '1、大学期间从事过家教辅导，大部分是高二高三地理，并获得过家长的好评； 2、2012年7月，作为南昌市园林绿化局“古树名木”项目采访队队员，走访了南昌市安义县、进贤县近三十多个乡镇，通过拍摄采访、实地走访等多种形式，调查了了近七十多棵古树名木背后的历史典故，撰写采访稿六十余篇，发表于南昌市古树名木画册《古树名木》。 3、2011年9月，在《南昌晚报》品牌推广部、社会部实习，跟随记者老师采访南昌市各种大小新闻事件，同时，负责《南昌晚报》暑期夏令营的运行与跟踪采访报道，新闻稿发表在《南昌晚报》近二十余篇；在校期间，参加南昌大学学生通讯社，培训学习过采访、摄影、编辑等采编摄录技术。||能优秀完成采写任务，擅长突发事件采访、人物专访、社会调查等；交往能力突出，喜欢品牌推广；文艺活力十足，擅长唱歌、写作、编剧、导演短剧；曾任学生社团办公室主任，领导能力好，擅长策划、组织、凝聚力培养。 　　 喜欢采访写作的工作，同时怀着一颗“先天下之忧而忧，后天下之乐而乐”“铁肩担道义，妙手著文章”的责任心，想让自己变得更有价值，为社会做些事儿，所以想成为一位媒体工作者；其次，擅长文艺活动，人际交往能力突出，可以成为一名优秀的品牌推广员，或者宣传员；有策划、组织、领导经验，假以时日可以胜任办公室文案、策划、组织、写作工作；最后，想尝试全新的工作，挑战自己，提高自己，带去属于我自己的贡献。 工作经历', '', '', '', '');
