INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '李琴', '32', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/376009x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn46/', '2014-01-18', '跟单/外贸', '湖北孝感', '大专', '', '', '', '', '', '2000-2999元', '', '2011.3-2013.6 赣州裕峰制有限公司 外贸部 外贸跟单 2800 负责报价,翻译客户资料,打样,生产,出货全程跟进及成本控制对制衣生产工艺相当熟悉,比较了解各种面辅料 2007.4-2011.3 国美国际有限公司 外贸部 外贸业务 4500 回赣州发展负责公司平台的维护，新产品及时更新上传,询盘的虚实性判断，及时回复跟进有效询盘针对客户对特殊产品的要求,在最快的时间内以各种方式找出三家以上的供应商的价格,比对报出合理的价格,尽可能的让供应商提供实样以便参考.在客户确认价格后,再对供应商的信誉作出评估自己工厂的产品:根据客户的指示书和样品报出合理的价格，注意考虑问题的全面性，包括出运方式、汇率的变化样品的确认，注意品质样、颜色样的及时提供，为大货生产赢得更多的时间，提供的同时注意留底，以便备查。确认样的安排，提供给工厂已翻译的清晰的详细打样资料，特别强调样品的时间最少要在给客户前一天到公司，确认无误后方可寄给客户。若发现问题来不及更改的情况下需经客户同意方可寄出。密切关注工厂生产进度，随时与客户沟通最新生产情况，根据日产量估计交期，，来不及的情况下及时通知工厂调整，确保大货交期；及时将进仓通知单传真到工厂，确认交期情况；出货后，要求工厂及时将装箱单传真到公司，核对出货情况。并通知客人及时与客人核对好出货情况及货款多次代表公司参加各地展会,如香港,广交会等。 2003.9-2004.11 广州德建机械有限公司 设计部 绘图/经理助理 2000 求学负责协助工程师绘制工程图纸，协助上司处理部门日常工作及与客户的沟通主要负责对部门内部图纸管理及发放，及需改零、部件的出图工作，协助上司处理本部门的日期工作及部分修改产品的跟进（协调工艺员与供应商的关系）||能独立的开发和接待及处理与客人的关系； 能独立处理采购事宜及协调与供应商的关系; 熟悉部门的文件管理流程及与外部门协调程序； 熟练操作AutoCAD绘图软件和Office办公软件； 对ERP管理软件，photoshop及pro-e有一定的了解； 态度积极工作细心，勇于承担责任，能承受工作压力。亲合力强，善于与客户沟通及处理客户投诉问题 能够以一颗平稳的心态对待生活中所经历的一切，能够在现实生活中不断上进，相信自己对待每一件事都可以做得更好！ 对于工作经验不足但积极上进的我，选择我，相信不会令你失望，希望贵司能够给予一个学习进步的机会。', '', '', '', '');
