INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '郭辉', '25', '男', 'http://www.jxdn.ccoo.cn/post/qiuzhi/303405x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn46/', '2013-11-23', '维修技术员', '中国', '高中/中专', '', '', '', '', '', '2000-2999元', '', '2011/04−−2012/02：郎翔科技|生产部|维修技术员/手机成售后维修 通讯（设备/运营/增值服务）|民营|规模:20-99人|3000-4000元/月 能处理整个生产流程中的工作（MTK升级平台和下载软件平台的搭建，做作业指导书） 对生产测试过程中的问题点进行跟踪，反馈，并对项目的软件和测试工作进行总结。 另有很好的维修经验，在客户要求试中得出试产报告等 在手机组装已有4年的工作经验，能熟练手机的生产流程，有一定的管理能力。 能快速维修不良成品手机，能熟练使用电烙铁和风枪，万用表等维修工具等 2008/04−−2010/02：深圳三美琦电子公司维修技术员 通讯（设备/运营/增值服务）|民营|规模:100-499人|2500-4500元/月 1．能及时控制不良品。 2。有较强的分析能力。 3。能熟练使用手机维修工具及简单的仪器仪表。 4。熟悉生产工艺流程，有较丰富的生产现场管理经验，产能、品质、成本管控能力||性情随和 喜欢交朋友 对事认真 该玩就玩 该做事就做事', '', '', '', '');
INSERT INTO jx_gz_dn_resume VALUES ('2016-11-29 12:30:39', '赖丽娟', '31', '女', 'http://www.jxdn.ccoo.cn/post/qiuzhi/235892x.html', 'http://www.jxdn.ccoo.cn/post/qiuzhi/pn46/', '2013-11-23', '赖丽娟个人简历', '赣州龙南人', '大专', '江西财经职业学院', '税务', '会计/出纳/收银员', '--', '应届毕业生', '面议', '', '一：东莞市蒙自源饮食有限公司(2009年7月-2012年12月)职位：采购员 工作描述：1、负责近200种食品类物料采购单据管理及发票跟进，处理80几家供应商的结款工作。 2、重点负责粮油、冻品、水吧、小吃等的采购订货，交期安排到货跟催以及物料质量反馈跟进。 3、制定物料月订购计划。 4、开发新供应商。 5、供应商证件维护。 二：东莞绿洲家具有限公司（2008年6月-2009年6月）职位：采购文员 工作描述：1、负责辅料、维修零配件、劳保用品、办公用品及医药用品的采购，完成采购报表。||1、3年5个月餐饮连锁行业餐饮连锁行业食品类采购经验；1年五金配件、生产辅料、劳保用品等采购经验。 2、办公室文职4年多工作经验，较强的沟通协调能力。 3、用友ERP系统4年操作经验，办公设备操作娴熟。 4、注重团队合作，具备优秀的团队协作能力。 5、办公室繁杂的工作，使我具备了较强的独立工作能力。 6、采购文员及采购员工作经历，使我具备了优秀的沟通协7、重复的事情创新地做，多年的社会实践提升了我的创新能力。 8、工作上认真负责，正直坦荡，工作以来都得到上级领导的肯定和支持。 7、热情开朗、真诚友好的性格，使我一直拥有很好的人际关系。', '', 'http://pccoo.cn/post/20130203/20130203160544724.jpg,http://pccoo.cn/post/20130203/20130203160545802.jpg', '', '');
